import React from 'react';
import { Link } from 'react-router-dom';

const MainMenu = () => {
	return (
		<div>
			<ul>
				<li>
					<Link to={'/'}>首页</Link>
				</li>
				<li>
					<Link to={'/a'}>用户信息</Link>
				</li>
				<li>
					<Link to={'/profile'}>用户信息</Link>
				</li>
			</ul>
		</div>
	);
};

export default MainMenu;
